import React, {Component} from 'react';
import { ListGroup, ListGroupItem } from 'reactstrap';

import './itemList.css'

export default class ItemList extends Component {

    render() {
        return (
            <ListGroup className="item-list list-group">
                <ListGroupItem>
                    John Snow
                </ListGroupItem>
                <ListGroupItem>
                    Brandon Stark
                </ListGroupItem>
                <ListGroupItem>
                    Geremy
                </ListGroupItem>
            </ListGroup>
        );
    }
}
